After I finished my SAT&rsquo;s I was reading a novel about the pitiful Ludia who had no partner. The friend of the stalker villainess, who gets her executed. The pushover who followed her friend that brought her doom, also known as extra 1. ...Why do I remember an extra who&rsquo;s of no importance? 

Damn it, I became that Ludia! I made up my mind that I won&rsquo;t die miserably and live on but&hellip;

Hello, crown prince.
Why are you straying away from the female lead, and keep getting entangled with me?
And why does he get so delusional!!

&ldquo;What should I do? What if the crown prince really fell in love with me&hellip;&rdquo;
&ldquo;Hm, that would never happen.&rdquo;
&ldquo;Why?&rdquo;
&ldquo;He was with me last night.&rdquo;

Since it happened this way, I might as well just snatch this man?!

I&rsquo;m a witch that&rsquo;s over 300 years old, but I died at the hands of a human I&rsquo;d trusted. I thought I&rsquo;d be stuck in the spiritual world forever, but I reincarnated as the princess of a violent and bloody imperial family, where siblings would murder each other for the throne.

Honestly, at this rate, I should just become the next emperor. I&rsquo;ll conquer the entire continent and attain my sweet revenge on Lacuz.

And so, I turned to evil and wicked ways, as befitting my role as a witch.

&ldquo;You. Become my vassal.&rdquo;

I even won over the princes with my overwhelming strength. So I thought that everyone would fear me, but&hellip;

&ldquo;I picked this up for you. You can decide to eat it or throw it away.&rdquo;
&ldquo;Can&rsquo;t you touch me just once? If I tell others that you stroked my head, they would be so jealous.&rdquo;

&hellip;What the hell? What&rsquo;s going on with them?

Wasn&rsquo;t this imperial family full of violence and murder? Shouldn&rsquo;t they be trying to kill me?

&ldquo;Keep doing it more. You&rsquo;re so cute.&rdquo;
&ldquo;You&rsquo;re cute no matter what you do, so do whatever you want.&rdquo;
&ldquo;You&rsquo;d be cute even if you killed someone&hellip;&rdquo;

The whole lot of them must have gone insane. They&rsquo;re all showing such unconditional love and affection towards me.

&ldquo;What do you think of a man 200 years younger than you?&rdquo;
To make things worse, the head mage of the magic tower, a complete oddball, is now clinging to me.

...Will I be able to sit on the throne?

&ldquo;Jeez&hellip; Going into heat in a place like this&hellip;&rdquo;

I hate this, but I can&rsquo;t stop my instinctual desire&hellip; I can&rsquo;t believe that this first-rate, yet horrible man is my fated match&hellip;

Niikura Wakana is a romance writer who can&rsquo;t sell. Her editor recommended an assignment to her: interview the &ldquo;first-rate alpha (&alpha;) male,&rdquo; the young leader of the Koukyou yakuza group, Tatara Kunimitsu, for a magazine article! To get closer to this beautiful man of mystery, Wakana poses as a hostess for a high-end club, but she can&rsquo;t stop sweating from her nervousness&hellip; or so she thought, but in reality, she was experiencing her first heat! Bewildered by the awakening of her omega (&Omega;) traits and unable to control or restrain her aching body, Wakana&rsquo;s pheromones attract a large group of men&hellip; In this desperate situation, the one who comes to the rescue is&hellip;?! Is this feeling love, or is it simply animalistic instinct&hellip;?

