Perdi, known widely throughout the continent, is a very famous author of adult novels. But Perdi&rsquo;s true identity is actually Vivian, the Imperial Night Librarian. 

Vivian sends over the 4th draft of her latest novel to her publisher to be reviewed, but her work is criticized because the way she writes hetero sex scenes isn&rsquo;t erotic at all. 

&ldquo;What, so you&rsquo;re saying I&rsquo;ll only know what sexual relationships are like after I experience it myself? But what can I do when I&rsquo;m bound to a chastity contract?&rdquo; 

Unfortunately for Vivian, she had to sign a chastity contract in order to be hired as an imperial servant, and has been forced to remain a virgin ever since. Worse still, only a member of the imperial family could break the contract... but Vivian only has eyes for Ray, a mysterious man who visits the library every night. 

But as it turns out, Ray is the imperial archduke and the emperor&rsquo;s brother! One day, he approaches her with a sweet offer that she can&rsquo;t resist&hellip;

Note: This is a promotional manhwa for a novel of the same name.

Short stories all centering around farewells in life. 
Story 1, &quot;Sister's Departure&quot; 
A boy has mixed feelings about his older sister moving out to live with her recently wed husband in Tokyo. 
Story 2, &quot;Pareidolia at Dawn&quot; 
Hakushio is a succubus who resides in a forest. Hakushio is perplexed by Niwa, who has no heart and wants to know what love is. 
Story 3, &quot;Spring, a Storm, and a Curtain Call&quot; 
Kaya and Shono are two girls in the theater club who are mulling over their future career paths. 
Story 4, &quot;Loop&quot; 
A textless story showing footage of a young woman. 
Story 5-6, &quot;Nectar Afterglow&quot; 
Fuji is a Nectarist, turning corpses into nectar for grieving families as a funeral ceremony. 
Story 7, &quot;Life of a Flower&quot; 
A man becomes a famous painter even though he feels he is nothing special.

